// colors
$white: rgba(255, 255, 255, 1);
$primaryPink: rgba(255, 184, 202, 1);
$lightPink: rgba(255, 245, 246, 1);
$textPink: rgba(255, 165, 186, 1);
$iconPink: rgba(254, 165, 187, 1);
$red: rgba(212, 20, 67, 1);
$coffe: rgba(240, 209, 165, 1);
$green: rgba(194, 226, 151, 1);
$lightGrey: rgba(225, 225, 225, 1);
$bgGray: rgba(250, 250, 250, 1);
$textGrey: rgba(144, 126, 130, 1);
$black: rgba(0, 0, 0, 1);

// dodano - Kasia
