sources.sass\\components\\_hero-header.scss:
// --- MOBILE ---
ul {
  list-style-type: none;
}
.container__header {
  padding-top: 6px;
  display: flex;
  align-items: center;
  justify-content: space-between;
}

.header-wrapper {
  position: relative;
  width: 100%;
  margin: 0 auto;
  background-color: $primaryPink;
  padding-bottom: 36px;
  z-index: 1;
}

.relative {
  position: relative;
  padding-bottom: 250px;
  overflow: hidden;
  z-index: 1;
}

.header {
  &__btn {
    display: none;
  }

  &__logo {
    font-size: 0;
  }
}

.mobile-menu {
  margin-bottom: 36px;

  &__link {
    display: block;
    font-weight: 700;
    font-size: 14px;
    line-height: 1.285;
    color: $white;
    padding-right: 35px;
    text-decoration: none;
    border-bottom: 1px solid $borderPink;
    margin-bottom: 10px;
    padding-bottom: 13px;

    &--last {
      padding-right: 0;
    }

    &:hover,
    &:focus {
      color: $red;
    }
  }
}

.header {
  &__tablet-menu {
    display: flex;
    justify-content: space-between;
    align-items: center;
  }
  &__btn {
    display: none;
  }

  &__logo {
    font-size: 0;
  }
}

.mobile__open-btn {
  height: 14px;
  width: 20px;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0;
  padding: 0;
  background-color: transparent;
  cursor: pointer;
  border: none;
  border-radius: 50%;
  outline: none;
}

.main-navigation {
  text-decoration: none;
  display: none;
}

.mobile-menu {
  position: fixed;
  top: 0;
  right: 0;
  width: 100%;
  visibility: hidden;
  height: 100%;
  padding: 60px 34px;
  background-color: $darkPink;
  box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.04), 0px 2px 4px rgba(0, 0, 0, 0.08),
    0px 1px 3px rgba(0, 0, 0, 0.16);
  z-index: 100;
  transform: translateX(100%);
  transition: visibility 250ms, transform 250ms cubic-bezier(0.4, 0, 0.2, 1);

  &__close-btn {
    position: absolute;
    top: 21px;
    right: 25px;
    fill: $white;
    background-color: transparent;
    border: none;
  }

  &__link {
    display: block;
    font-weight: 700;
    font-size: 14px;
    line-height: 1.285;
    color: $white;
    text-decoration: none;
    border-bottom: 1px solid $borderPink;
    margin-bottom: 10px;
    padding-bottom: 13px;
    transition: color 250ms cubic-bezier(0.4, 0, 0.2, 1);

    &--last {
      padding-right: 0;
      margin-bottom: 0;
    }

    &:hover,
    &:focus {
      color: $red;
    }
  }

  &__btn {
    width: 209px;
    height: 44px;
    color: $red;
    font-weight: 700;
    font-size: 16px;
    line-height: 1.31;
    text-align: center;
    padding: 12px 0;
    background-color: $white;
    border: none;
    border-radius: 22px;
    display: block;
    cursor: pointer;
    margin: 0 auto 30px;
    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);

    &:hover,
    &:focus {
      background-color: $hoverGrey;
    }

    &-icon {
      margin-left: 12px;
      fill: $red;

    }
  }
}

.mobile-menu.is-open {
  transform: translateX(0);
  visibility: visible;
}

.hero {
  position: relative;
  z-index: 2;
  background-color: $primaryPink;
  padding-top: 27px;
  min-height: 445px;

  &__ul {
    position: relative;
    top: 137px;
    z-index: 2;
  }

  &__title {
    font-family: 'Titan One', cursive;
    font-style: normal;
    font-weight: 400;
    font-size: 26px;
    letter-spacing: 0.04em;
    text-transform: uppercase;
    color: $white;
    padding-bottom: 19px;
    margin: 0;

    &--accent {
      font-size: 48px;
      color: $red;
      line-height: 0.95;
      display: block;
    }
  }

  &__list-item {
    display: flex;
    gap: 8px;

    &--tablet {
      display: none;
    }
  }

  &__btn {
    font-size: 8px;
    line-height: 1.25;
    text-align: center;
    border: none;
    border-radius: 20px;
    padding: 7px 14px;
    display: block;
    text-decoration: none;
    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);


    &--dark {
      color: $white;
      background-color: $red;

      &:hover {
        background-color: #c7133e;
      }
    }

    &--light {
      color: $red;
      background-color: $white;

      &:hover {
        background-color: #ecebeb;
      }
    }
  }

  &__ellipse-picture {
    position: absolute;
    top: 9px;
    right: 32px;
    margin: 0;
    display: block;
    font-size: 0;
    z-index: 2;
  }

  &__ellipse {
    position: absolute;
    width: 346px;
    min-height: 410px;
    top: 0;
    right: 0;
    overflow: hidden;
    z-index: 1;
  }

  &__ellipse-bg {
    position: absolute;
    background-color: $textPink;
    width: 346px;
    height: 344px;
    border-radius: 50%;
    top: 0;
    right: -62px;
    overflow: hidden;
    z-index: 1;
  }

  &__ice {
    width: 171px;
    height: 410px;
  }

  &__woman {
    display: none;
  }

  &__list-number {
    display: none;
  }
}
@media screen and (min-width: 480px) {
  .hero__ellipse {
    right: 0;
    overflow: visible;
  }
  .relative {
    overflow: visible;
  }
}

// --- TABLET ---
@media screen and (min-width: 768px) {
  .header-wrapper {
    padding-top: 37px;
  }

  .header {
    &__btn {
      margin-left: 30px;
      width: 186px;
      color: $red;
      font-weight: 700;
      font-size: 16px;
      line-height: 1.31;
      text-align: center;
      padding: 12px 0;
      background-color: $white;
      border: none;
      border-radius: 22px;
      display: block;
      cursor: pointer;
      transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);


      &:hover,
      &:focus {
        background-color: $hoverGrey;
      }

      &-icon {
        margin-left: 12px;
        fill: $red;
      }
    }
  }

  .mobile-menu {
    width: 254px;
  }

  .relative {
    padding-bottom: 28px;
    display: flex;
    justify-content: space-between;
  }

  .hero {
    min-height: 300px;

    &__ul {
      top: 0;
    }
    &__list-number-ul {
      margin: 0;
      position: relative;
      top: -50px;
    }

    &__title {
      padding-bottom: 20px;
      padding-top: 15px;
      font-size: 22px;
      line-height: 1.13;

      &--accent {
        font-size: 34px;
        line-height: 0.91;
      }
    }

    &__list-item--tablet {
      display: flex;
      gap: 0;
      padding-top: 19px;
      align-items: flex-end;
    }

    &__milk {
      width: 124px;
      height: 126px;
      display: block;

      &-neighbour {
        margin-left: -4px;
        margin-bottom: 6px;
      }

      &-text {
        display: block;
        max-width: 114px;
        font-size: 8px;
        line-height: 1.5;
        color: $white;
        padding-bottom: 7px;
      }

      &-btn {
        padding: 0;
        display: flex;
        align-items: center;
        justify-content: center;
        width: 26px;
        height: 26px;
        border-radius: 50%;
        border-style: none;
        background-color: $white;

        &:focus,
        &:hover {
          background-color: $red;
          cursor: pointer;
        }

        &:focus .hero__milk-btn-icon,
        &:hover .hero__milk-btn-icon {
          fill: $white;
          cursor: pointer;
        }

        &-icon {
          width: 26px;
          height: 26px;
          stroke-width: 0;
          fill: $red;
        }
      }
    }

    &__ellipse-picture {
      position: absolute;
      top: 32px;
      left: 71px;
      margin: 0;
      display: block;
      font-size: 0;
      z-index: 2;
    }

    &__ellipse {
      position: absolute;
      width: 324px;
      min-height: 336px;
      top: -55px;
      left: 245px;
      z-index: 1;
    }

    &__ellipse-bg {
      position: absolute;
      background-color: $textPink;
      width: 324px;
      height: 322px;
      top: 0;
      right: 0;
    }

    &__ice {
      width: 143px;
      height: 336px;
    }

    &__woman picture {
      display: block;
      font-size: 0;
    }

    &__woman {
      display: block;
      position: absolute;
      bottom: 0;
      right: 34px;
      z-index: 3;

      &-photo {
        width: 168px;
        height: 133px;
      }
    }

    &__list-number {
      display: block;
      padding-right: 10px;
      position: relative;

      &::after {
        content: ' ';
        display: block;
        width: 16px;
        height: 16px;
        background-color: $white;
        border-radius: 50%;
        position: absolute;
        top: -2px;
        left: 35px;
        z-index: -1;
      }

      &-title {
        font-family: 'Titan One';
        font-style: normal;
        font-weight: 400;
        font-size: 28px;
        line-height: 1.14;
        text-align: right;
        letter-spacing: 0.04em;
        text-transform: uppercase;
        color: $red;

        &--first {
          margin-top: 9px;
        }

        &--last {
          margin-top: 14px;
        }
      }

      &-dsc {
        font-size: 8px;
        line-height: 0.8;
        text-align: right;
        color: $white;
      }
    }
  }
}

// --- DESKTOP ---
@media screen and (min-width: 1280px) {
  .relative {
    padding-bottom: 45px;
    padding-top: 34px;
  }

  .mobile__open-btn {
    display: none;
  }

  .header__logo {
    margin-right: 110px;
  }

  .main-navigation {
    min-width: 541px;
