      font-weight: 500;
      font-size: 12px;
      line-height: 255%;
      text-align: center;
      display: flex;
      flex-direction: column;
      justify-content: center;
      max-width: 157px;
      background: repeating-linear-gradient(#fafafa, #fafafa 28px, #e1e1e1 28px, #e1e1e1 30px);
      z-index: 0;
      position: relative;

      @media screen and (min-width: 768px) {
        font-weight: 500;
        font-size: 14px;
        line-height: 216%;
        text-align: center;
        letter-spacing: 0.04em;
        color: $black;
        max-width: 460px;
        max-height: 83px;
        background: repeating-linear-gradient(#fafafa, #fafafa 26px, #e1e1e1 26px, #e1e1e1 28px);
