    &-text::before {
      z-index: -1;
      color: #e1e1e1;
      width: 54px;
      height: 40px;
      content: url('../images/cudzyslow.png');
      position: absolute;
      top: -17px;
      left: 9px;

      @media screen and (min-width: 768px) {
        top: -23px;
        left: -40px;
      }
      @media screen and (min-width: 1280px) {
        top: -20px;
        left: -38px;
      }
