      justify-content: center;
      align-items: center;
      flex-direction: row;
      gap: 10px;
      color: $elipseRed;

      &-items {
        padding-left: 0px;
        color: $elipseRed;
        list-style: none;
        text-decoration: none;
      }

      &-tytul {
        margin-top: 18px;
        align-items: center;
        font-weight: 500;
        font-size: 14px;
        line-height: 1.86;
        text-align: center;
        letter-spacing: 0.02em;
        color: $black;

        @media screen and (min-width: 768px) {
          margin-top: 15px;
          font-size: 16px;
        }

        @media screen and (min-width: 1280px) {
          margin-top: 13px;
          align-items: center;
          font-weight: 500;
          font-size: 20px;
          line-height: 1.86;
          text-align: center;
          letter-spacing: 0.02em;
          color: $black;
        }
