}

sources.sass\\components\\_contacts.scss:
/*--- global ---*/
.contacts {
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  ul {
    list-style: none;
  }

  &__container {
    z-index: 3;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
  }
}
// link-global
.contacts {
  &__email-tel {
    a {
      font-family: 'DM Sans', sans-serif;
      font-weight: 500;
      color: $textGrey;
      text-decoration: none;
    }
  }
}
// lists-global
.contacts {
  &__list {
    z-index: 3;
    padding-left: 0px;
    margin: 0;
  }
  &__list-days {
    padding-left: 0%;
    display: flex;
    flex-direction: column;
  }
  &__list-item {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    background-color: $white;
    box-shadow: 0px 0px 35px -12px rgb(255, 184, 202);
    border-radius: 24px;
  }
  &__item {
    padding: 0px;
    display: grid;
    &:nth-child(1) {
      grid-column: 1;
      grid-row: 1;
    }
    &:nth-child(2) {
      grid-column: 1;
      grid-row: 2;
    }
    &:nth-child(3) {
      grid-column: 1;
      grid-row: 3;
    }
  }
  &__email-tel {
    display: flex;
    flex-direction: column;
  }
}
// header-global
.contacts {
  h3 {
    font-weight: 500;
    font-family: 'DM Sans', sans-serif;
  }
  h4 {
    font-weight: 500;
    font-family: 'DM Sans', sans-serif;
  }
  &__none-header {
    display: none;
  }
}
.contacts {
  &__header-caffe {
    align-self: flex-start;
    color: $white;
    width: 80px;
    height: 16px;
    background-color: $coffe;
    display: flex;
    align-items: center;
    justify-content: center;
    border-radius: 4px;
  }
  &__header-truck {
    align-self: flex-start;
    color: $white;
    width: 130px;
    height: 16px;
    background-color: $green;
    display: flex;
    align-items: center;
    justify-content: center;
    border-radius: 4px;
  }
  &__header-description {
    color: $black;
  }
  &__header-days {
    color: $black;
  }
}
// text-global
div {
  p {
    font-weight: 500;
    color: $textGrey;
    font-family: 'DM Sans', sans-serif;
  }
}
.contacts {
  &__p-days {
    font-family: 'DM Sans', sans-serif;
    color: $textPink;
  }
}
// buttons-global
button {
  cursor: pointer;
}
.contacts {
  &__button-franchise:focus {
    outline: none;
    background-color: $red;
    .button-text {
      color: $white;
    }
    .button-icon {
      fill: $white;
    }
  }
  &__franchise {
    text-decoration: none;
    outline: none;
  }

  &__buttons {
    z-index: 3;
    display: flex;
  }
  &__button-location {
    border: none;
    background-color: $red;
    border-radius: 25px;
    width: 161px;
    height: 44px;
    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
    .button-text {
      font-family: 'DM Sans', sans-serif;
      font-weight: 700;
      font-size: 16px;
      line-height: 21px;
      color: $white;
      transition: color 250ms cubic-bezier(0.4, 0, 0.2, 1);
    }
  }
  &__button-franchise {
    border: none;
    background-color: $white;
    width: 161px;
    height: 44px;
    border-radius: 25px;
    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
    .button-text {
      font-family: 'DM Sans', sans-serif;
      font-weight: 700;
      font-size: 16px;
      line-height: 21px;
      color: $red;
      transition: color 250ms cubic-bezier(0.4, 0, 0.2, 1);
    }
  }
  &__button-location {
    display: flex;
    align-items: center;
    justify-content: center;
    gap: 13.17px;
    margin-bottom: 10px;
    .button-icon {
      width: 10px;
      height: 10px;
      fill: $white;
      transition: fill 250ms cubic-bezier(0.4, 0, 0.2, 1);
    }
  }
  &__button-franchise {
    display: flex;
    align-items: center;
    justify-content: center;
    gap: 13.17px;
    .button-icon {
      width: 10px;
      height: 10px;
      fill: $red;
      transition: fill 250ms cubic-bezier(0.4, 0, 0.2, 1);
    }
  }
  &__button-franchise:hover {
    background-color: $red;
    .button-text {
      color: $white;
    }
    .button-icon {
      fill: $white;
    }
  }

  &__button-location:hover {
    background-color: $white;
    .button-text {
      color: $red;
    }
    .button-icon {
      fill: $red;
    }
  }
  &__button-location:focus {
    outline: none;
    background-color: $white;
    .button-text {
      color: $red;
    }
    .button-icon {
      fill: $red;
    }
  }
}
/*------*/

/*--- mobile-set ---*/
/*... grid-set ...*/
@media screen and (min-width: 320px) and (max-width: 767px) {
  .contacts {
    &__list {
      align-items: center;
      justify-content: center;
